import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card"

export default function PostingDetails() {
  const jobTtile = "Software Development Engineer";
  const companyName = "Walmart";
  const jobDescription =
    "Lorem ipsum dolor sit amet consectetur adipisicing elit. Perspiciatis temporibus cupiditate repellendus saepe nemo aut odio reprehenderit molestiae omnis impedit! Nulla officiis deserunt facere eaque voluptatibus, praesentium culpa dicta error!";
  return (
    <Card variant="outlined">
      <Typography variant="h4">{jobTtile}</Typography>
      <Typography variant="h5">{companyName}</Typography>
      <Typography variant="p">{jobDescription}</Typography>
    </Card>
  );
}
